import * as React from 'react';
import { useSelector } from "react-redux";
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: 'userName', headerName: 'Username', width: 130 },
  { field: "city", headerName: "City", width: 120 },
  { field: "verifiedTeam", headerName: "Verified Team", width: 200 }
];

const rows = [
  { id: 1, userName: "rMoore", city: "Richland", verifiedTeam: "✅"},
  { id: 2, userName: "cMcEachern", city: "Mukilteo", verifiedTeam: ""},
  { id: 3, userName: "mRoberts", city: "Bellevue", verifiedTeam: "✅"},
  { id: 4, userName: "dConnell", city: "Camas", verifiedTeam: ""},
  { id: 5, userName: "pHogan", city: "Seattle", verifiedTeam: ""},
  { id: 6, userName: "jPerrin", city: "Lakeside", verifiedTeam: "✅"},
  { id: 7, userName: "nDiMartino", city: "Seattle", verifiedTeam: ""},
  { id: 8, userName: "cLaird", city: "Bothell", verifiedTeam: ""},
  { id: 9, userName: "bBrown", city: "Portland", verifiedTeam: ""},
  { id: 10, userName: "aWalde", city: "Coeur D'Alene", verifiedTeam: "✅"},
];

export default function DataTable() {
  const friends = useSelector(state => state.state)
  return (
    <div style={{ height: 400, width:"50%", alignContent:"center"}}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
